import React, { Component } from 'react';
import Header from './component/Header';
class App extends Component {
  render() {
    return (
      <div>
        <Header/>
        <div>
          <ul>
            <li>Trang chu</li>
            <li>Phim Le</li>
            <li>Phim Bo</li> 
          </ul>
        </div>
      </div>
    );
  }
}

export default App;
